// SPDX-License-Identifier: MIT
pragma solidity ^0.5.0;

import "./ProposalBase.sol";

contract MultipleProposal is ProposalBase {

    struct VoterEntity {
        uint256[] voteItems;
        uint256[] amounts;
        uint index;
    }

    mapping(address => VoterEntity) voterEntities;

    event Voted(address account, uint256[] voteItems, uint256[] ratios);

    constructor(address _governance,
        address _pool,
        uint256 _startHeight,
        uint256 _finishHeight,
        string memory _title,
        string memory _link,
        string memory _description,
        uint256 _itemCount) public
        ProposalBase(_governance, _pool, _startHeight, _finishHeight, _title, _link, _description, _itemCount)
    {}

    function vote(uint256[] calldata voteItems, uint256[] calldata ratios) external updatePoolSnapshot {
        require(block.number >= startHeight && block.number <= finishHeight, "MultipleProposal: not in voting period");
        require(enableContractVote || !isSmartContract(), "MultipleProposal: smart contract can not vote");
        require(voteItems.length > 0 && voteItems.length <= totalVotes.length && voteItems.length == ratios.length, "MultipleProposal: invalid parameter");
        require(insurancePool.balanceOf(msg.sender) > 0, "MultipleProposal: No voting rights");
        require(!exist(msg.sender), "MultipleProposal: already voted");

        voterEntities[msg.sender].amounts = new uint256[](voteItems.length);

        uint index = voterList.push(msg.sender) - 1;
        uint256 total = insurancePool.balanceOf(msg.sender).mul(itemContents.length);
        uint256 ratio = 0;
        for (uint i = 0; i < voteItems.length; i++) {
            require(voteItems[i] < totalVotes.length, "MultipleProposal: no such vote");
            voterEntities[msg.sender].amounts[i] = total.mul(ratios[i]).div(1e18);
            totalVotes[voteItems[i]] = totalVotes[voteItems[i]].add(voterEntities[msg.sender].amounts[i]);
            ratio = ratio.add(ratios[i]);
        }

        require(ratio <= 1e18, "MultipleProposal: Ratio must be less than 1");

        voterEntities[msg.sender].voteItems = voteItems;
        voterEntities[msg.sender].index = index;

        emit Voted(msg.sender, voteItems, ratios);
    }

    function exist(address voter) public view returns (bool) {
        if(voterList.length == 0 || voterEntities[voter].index >= voterList.length) return false;
        return (voterList[voterEntities[voter].index] == voter);
    }

    function getVoteDetail(address voter) external view returns (uint256[] memory, uint256[] memory) {
        require(exist(voter), "MultipleProposal: not vote yet");
        return (voterEntities[voter].amounts, voterEntities[voter].voteItems);
    }

}
